function title_page(){
	if(typeof user.history == "undefined"){
		user.history = JSON.parse('{}');
	}else if(user.history == ''){
		user.history = JSON.parse('{}');
	}else{
		user.history = JSON.parse(user.history);
	}


	if(typeof user.pickedLog == "undefined"){
		user.pickedLog = JSON.parse('{}');
	}else if(user.pickedLog == ''){
		user.pickedLog = JSON.parse('{}');
	}else{
		user.pickedLog = JSON.parse(user.pickedLog);
	}

	var ua = navigator.userAgent.toLowerCase();
	var isAndroid = ua.indexOf("android") > -1;
	if(isAndroid) {
		titleData.config.maximumSmallDollCount = 30;
	}else{
		titleData.config.maximumSmallDollCount = 30;
	}
	craneScale = get_level().level * 0.01 + 0.7;
	title_rope_pointB_adjust = [];
	for(var i=0;i<22;i++){
		title_rope_pointB_adjust[i] = {
			x : title_rope_pointB_adjust2[i].x * craneScale,
			y : title_rope_pointB_adjust2[i].y * craneScale
		};
	}
	title_page2();
}





